import React, { Component } from 'react';
import maintitle from './images/main-title.svg';
import './App.css';

class App extends Component {
    render() {
        return (
            
            <div className="App">
                <View style={styles.container}>
                <Image
                    style={styles.maintitle}
                    source={maintitle}
                    />
                </View>
            </div>
        );
    }
}

export default App;
